import React, { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';  // Import useNavigate

function DirectoryList() {
  const [directories, setDirectories] = useState([]);
  const navigate = useNavigate();  // Hook to handle navigation

  useEffect(() => {
    fetch('http://localhost:8080/api/directories/')
      .then(response => response.json())
      .then(data => setDirectories(data))
      .catch(error => console.error('Error fetching directories:', error));
  }, []);

  return (
    <div className="container mx-auto mt-5">
      <h1 className="text-2xl font-bold text-center mb-4">Directories</h1>
      <ul className="list-disc pl-5">
        {directories.map(directory => (
          <li key={directory.id} className="text-blue-500 hover:text-blue-700 cursor-pointer"
              onClick={() => navigate(`/directory/${directory.id}`)}>
            {directory.name}
          </li>
        ))}
      </ul>
    </div>
  );
}

export default DirectoryList;
